import styles from "./Navbar.module.css";
import LoginBtn from "../../buttons/Login/LoginBtn";

function Navbar() {
  return (
    <nav className={styles.navbar}>
      <div className={styles.container}>
        <LoginBtn />
      </div>
    </nav>
  );
}

export default Navbar;
